def buildblock(size):
        out_str = ''
        LOWERCASE = range(97, 122)
        _UPPERCASE = range(65, 90)
        _NUMERIC   = range(48, 57)
        validChars = _LOWERCASE + _UPPERCASE + _NUMERIC
        for i in range(0, size):
            a = random.choice(validChars)
            out_str += chr(a)
        for i in range(0, size):
                a = random.randint(65, 90)
                out_str += chr(a)
        return(out_str)
		

